import React, { useEffect, useState } from 'react';
import { fetchSpotifyData, fetchYoutubeData } from '../api';

const Dashboard = ({ spotifyToken, youtubeToken }) => {
  const [spotifyData, setSpotifyData] = useState(null);
  const [youtubeData, setYoutubeData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      if (spotifyToken) {
        const data = await fetchSpotifyData(spotifyToken);
        setSpotifyData(data);
      }
      if (youtubeToken) {
        const data = await fetchYoutubeData(youtubeToken);
        setYoutubeData(data);
      }
    };
    fetchData();
  }, [spotifyToken, youtubeToken]);

  return (
    <div>
      <h1>Dashboard</h1>
      {spotifyData && (
        <div>
          <h2>Spotify Recent Tracks</h2>
          <ul>
            {spotifyData.items.map((track) => (
              <li key={track.track.id}>
                {track.track.name} by {track.track.artists.map(artist => artist.name).join(', ')}
              </li>
            ))}
          </ul>
        </div>
      )}
      {youtubeData && (
        <div>
          <h2>YouTube Recent Videos</h2>
          <ul>
            {youtubeData.items.map((video) => (
              <li key={video.id.videoId}>
                {video.snippet.title}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
